import React from 'react';
import JSON from './../styles/json/styles.json';

const {section} = JSON;

const Section = () => {

    return(
      <>
      {
        section.map((style, k) =>
          <section key={k} className={style.wrap}>
          </section>
        )}
      </>
    )

}
export default Section;
